import Products from './components/Home/Products.jsx';
import About_us from './components/About_us/About_us.jsx';

import HeroSection from './components/Homepage/HeroSection.jsx';
import Navbar from './components/Homepage/navbar.jsx';
// import Nav from './components/Nav/Nav/Nav.jsx';
// import ContactUs from './components/Contact_us/Contact_us.jsx';



const StyledDiv = styled.div`font-family: 'Outfit', sans-serif;    color: #333;`;

function App() {

  return (
    <>
    <StyledDiv>
      <Navbar/>

    <HeroSection/>
    <Partner/>
    <Whoarewe/>
    <Products/>
    <Vision/> 
    {/* <About_us/> */}

    {/* <TMT_Bars/> */}
    {/* <ContactUs/> */}


    </StyledDiv>
    </>
  );
}

export default App;
